    [],nt"revision_timestamp": "2015-05-27T02:39:56.088054",nt"name": "rm08-09-50gv2-tif",nt"isopen":
    false,nt"url": null,nt"notes": "During the summers of 2008 and 2009 the
    USGS conducted bathymetric surveys from West Ship Island, Miss., to Dauphin Island,
    Ala., as part of the Northern Gulf of Mexico (NGOM) Ecosystem Change and Hazard
    Susceptibility project. The survey area extended from the shoreline out to approximately
    2 kilometers and included the adjacent passes. The bathymetry was primarily used
    to create a topo-bathymetric map and provide a base-level assessment of the seafloor
    following the 2005 hurricane season. Additionally, these data will be used in conjunction
    with other geophysical data (chirp and side scan sonar) toward constructing a comprehensive
    geological framework of the Mississippi Barrier Island Complex. The culmination
    of the geophysical surveys will provide the data necessary for scientists to define,
    interpret, and provide baseline bathymetry and seafloor habitat for this area and
    to aid scientists in predicting future geomorpholocial changes of the islands with
    respect to climate change, storm impact, and sea-level rise. Furthermore, these
    data provide information for feasibility of barrier island restoration, particularly
    in Camille Cut, and efforts for the preservation of historical Fort Massachusetts.",nt"license_title":
